import ListingView, { NextComponent } from '../views/ListingView';
import EntryView from '../views/EntryView';
import SearchView from '../views/SearchView';

const routes = [
    {
        path: '/search',
        component: SearchView,
        exact: true
    },
    {
        path: '/listing',
        component: ListingView,
        exact: true
    },
    {
        path: '/entry',
        component: EntryView,
        exact: true
    },
    {
        path: '/new',
        component: NextComponent,
        exact: true
    },
    {
        path: '/',
        component: SearchView,
        exact: true
    }
];

export default routes;
